import { useState } from 'react'
import useFetch from '../hooks/useFetch'

function GetUsers(){
    const [, setUserList] = useState()
    const users = useFetch('http://127.0.0.1:3000/service/users')
        return (

            <div>
                {users?.map(u => 
                <ul key={u.id} value={u.username} onClick={e=>setUserList(e.target.value)}>{u.username}</ul>
            )}
            </div>   
        )
 }

 export default GetUsers
